import React, { Component } from 'react';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";

class Placelist extends Component{
    constructor() {
        super(); // 调用基类的所有初始化方法
        this.state = {
          list: [
              {title:"1.火星一号地皮",listId:1},
              {title:"2.火星一号地皮",listId:2},
              {title:"3.火星一号地皮",listId:3},
              {title:"4.火星一号地皮",listId:4},
              {title:"5.火星一号地皮",listId:5},
              {title:"6.火星一号地皮",listId:6},
              {title:"7.火星一号地皮",listId:7},
            ]
        }
    }
    render() {
      return <ul>
        <li>
            <p>1.火星一号地皮</p>
            <button className="compete_btn" type="button">竞标</button>
        </li>
        <li>
            <p>2.火星二号地皮</p>
            <button className="compete_btn" type="button">竞标</button>
        </li>
        <li>
            <p>3.火星三号地皮</p>
            <button className="compete_btn" type="button">竞标</button>
        </li>
        <li>
            <p>4.火星四号地皮</p>
            <button className="compete_btn" type="button">竞标</button>
        </li>
        </ul>
    }
}

export default Placelist;
